	add("pathic", "{\"term\":\"pathic\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From Latin \u0027pathicus\u0027 from Ancient greek (to 1453) \u0027παθικός\u0027 from \u0027πάθος\u0027 (suffering”, “feeling) from \u0027πάσχω\u0027 (i feel”, “i suffer)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The passive male partner in anal intercourse\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1810\u0027\u0027, Lord Byron, letter (to Henry Drury), 3 May 1810\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In England the vices in fashion are whoring \u0026amp; drinking, in Turkey, Sodomy \u0026amp; smoking, we prefer a girl and a bottle, they a pipe and \u0027\u0027pathic\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1959\u0027\u0027: William Burroughs, \u0027Naked Lunch\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"And enough of these gooey saints with a look of \u0027\u0027pathic\u0027\u0027 dismay as if they getting fucked up the ass and try not to pay any mind\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1975\u0027\u0027: Robertson Davies, \u0027World of Wonders\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"But in those days I was Paul Dempster, who had been made to forget it and take a name from the side of a barn, and be the \u0027\u0027pathic\u0027\u0027 of a perverted drug-taker\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1976\u0027\u0027: Robert Nye, \u0027Falstaff\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"Clermont (known to his friends as Cordelia) was a nancy, a \u0027\u0027pathic\u0027\u0027, a male varlet, a masculine whore\", \"priority\":9}]}, \"synonyms\":{}}");

