	add("pathos", "{\"term\":\"pathos\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027πάθος\u0027 (suffering)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality or property of anything which touches the feelings or excites emotions and passions, especially that which awakens tender emotions, such as pity, sorrow, and the like; contagious warmth of feeling, action, or expression; pathetic quality\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1874\u0027\u0027, Thomas Hardy, \u0027Far From The Madding Crowd,\u0027 1874\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"His voice had a genuine \u0027\u0027pathos\u0027\u0027 now, and his large brown hands perceptibly trembled\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A writer or speaker\u0027s attempt to persuade an audience through appeals involving the use of strong emotions such as pity\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"An author\u0027s attempt to evoke a feeling of pity or sympathetic sorrow for a character\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"In theology and existentialist ethics following Kierkegaard and Heidegger, a deep and abiding commitment of the heart, as in the notion of \u0026quot;finding your passion\u0026quot; as an important aspect of a fully lived, engaged life\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Suffering; the enduring of active stress or affliction\", \"priority\":7}]}, \"synonyms\":{}}");

