	add("patina", "{\"term\":\"patina\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From French \u0027patine\u0027 (patina) from Latin \u0027patina\u0027 (dish, pan) from Ancient greek (to 1453) \u0027πατάν\u0027 from Proto-indo-european {{m|ine-pro|*pet-ano-||}}, from {{m|ine-pro|*pete||to spread out}}, same source as \u0027πέταλον\u0027 (leaf)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A paten, flat type of dis\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The color or incrustation which age and wear give to (mainly metallic) objects; especially, the green rust which covers works of art such as ancient bronzes, coins and medals\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A green colour, tinted with grey, like that of bronze patina\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A gloss or superficial layer\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Alison Winter, \u0027Memory: Fragments of a Modern History\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"It demonstrates how scientific authority could be constructed on the fly, as it were, by someone with no connections and no psychological credentials who offered a technique that had the \u0027\u0027patina\u0027\u0027 of modern science\", \"priority\":6}]}, \"synonyms\":{}}");

